import Navigation from "./components/Navigation/Navigation";
import Footer from "./components/Footer/Footer";
import Wrapper from "./components/UI/Wrapper";

import Home from "./pages/Home";

function App() {
  return (
    <Wrapper>
      <Navigation />
      <main>
        <Home />
      </main>
      <Footer />
    </Wrapper>
  );
}

export default App;

